import Link from 'next/link'

export default function NotFound(){
    return (
        <div style={{textAlign:"center"}}>
            <h1>
                Not Found
            </h1>
            <Link href='/'>
                <a>Back to Home</a>
            </Link>
        </div>
    )
}
